  false,\n\t\"url\": null,\n\t\"notes\": \"This report synthesizes results of hydrologic
  research conducted at NSNWR and presents scientific conclusions and insights gained
  from long-term monitoring.  However, the report goes one step further.  Scientific
  conclusions are also integrated with pragmatic concerns of land management to provide
  new information about the process of ecological restoration.  In this way, the adaptive
  management loop can be completed by linking the scientific research to the knowledge
  base needed to better manage future refuge activities.\",\n\t\"license_title\":
